### Summary of Core Topics, Concepts, Principles, and Equations

#### Core Topics and Concepts

1. **Java Interfaces and Default Methods**
   - Interfaces can have default methods with implementations.
   - Classes implementing interfaces can override default methods.
   - Example:
     ```java
     interface Bookable {
         public default void book() {
             System.out.println("Books");
         }
     }
     ```

2. **Polymorphism and Method Overriding**
   - Polymorphism allows a subclass to provide a specific implementation of a method that is already defined in its superclass.
   - Example:
     ```java
     class MLA {
         public void campaign() {
             System.out.println("Campaigns in one constituency");
         }
     }
     class MP extends MLA {
         @Override
         public void campaign() {
             System.out.println("Campaigns in nine constituencies");
         }
     }
     ```

3. **Inheritance and Constructors**
   - Subclasses can inherit fields and methods from superclasses.
   - Constructors in subclasses can call superclass constructors using `super()`.
   - Example:
     ```java
     class Player {
         private String name;
         private double salary;
         public Player(String n, double s) {
             name = n;
             salary = s;
         }
     }
     class Captain extends Player {
         String viceCaptain;
         public Captain(String vc) {
             super("ABC", 5000000.0);
         }
     }
     ```

4. **Static and Instance Variables**
   - Static variables are shared among all instances of a class.
   - Instance variables are unique to each instance.
   - Example:
     ```java
     class Student {
         private String name;
         private static String course;
         private final int sems;
         Student() {
             name = null;
             course = null;
             sems = 8;
         }
     }
     ```

5. **Nested Classes and Interfaces**
   - Classes can be nested within other classes.
   - Nested classes can access members of the enclosing class.
   - Example:
     ```java
     class Faculty {
         private class FacIter implements Iterator {
             public boolean has_next() {
                 return false;
             }
             public Object get_next() {
                 return null;
             }
         }
         public Iterator getIterator() {
             return new FacIter();
         }
     }
     ```

6. **Method Overloading and Overriding**
   - Method overloading involves defining multiple methods with the same name but different parameters.
   - Method overriding involves providing a new implementation for a method in a subclass.
   - Example:
     ```java
     class Director extends AsstDirector {
         public Director(String n, AsstDirector a, int ac) {
             super(n, 1.5 * (a.salary));
             this.asst_count = ac;
         }
         public Director(Director d) {
             super(d.name, d.salary);
             this.asst_count = d.asst_count;
         }
     }
     ```

7. **Switch Statements**
   - Switch statements allow for multiple branching based on the value of a variable.
   - Example:
     ```java
     switch (i) {
         case 1:
             System.out.println("Concepts");
         case 2:
             System.out.println("Programming");
     }
     ```

8. **Object Casting and Type Checking**
   - Objects can be cast to different types, and type checking can be done using `instanceof`.
   - Example:
     ```java
     if (obj instanceof ComplexNumber) {
         ComplexNumber c1 = (ComplexNumber) obj;
     }
     ```

9. **Abstract Classes and Methods**
   - Abstract classes cannot be instantiated and may contain abstract methods.
   - Abstract methods are declared without an implementation.
   - Example:
     ```java
     abstract class Printable implements Summable {
         public abstract void print();
     }
     ```

10. **Access Modifiers**
    - Access modifiers (public, private, protected) control the visibility of classes, methods, and fields.
    - Example:
      ```java
      class Bicycle {
          private String model;
          private String price;
          public Bicycle(String m, String p) {
              model = m;
              price = p;
          }
      }
      ```

11. **Static Typing and Subtyping**
    - Static typing involves type checking at compile time.
    - Subtyping involves relationships between different types.
    - Example:
      ```java
      interface Summable {
          public Object twoSum(Object o1);
      }
      ```

12. **Method Invocation and Object References**
    - Methods can be invoked on object references, and the actual method called depends on the runtime type of the object.
    - Example:
      ```java
      MLA obj1 = new PM();
      obj1.campaign();
      ```

#### Principles

1. **Encapsulation**
   - Encapsulation is the bundling of data and methods that operate on the data within a single unit (class).
   - Example:
     ```java
     class Player {
         private String name;
         private double salary;
         public Player(String n, double s) {
             name = n;
             salary = s;
         }
     }
     ```

2. **Inheritance**
   - Inheritance allows a class to inherit properties and methods from another class.
   - Example:
     ```java
     class MP extends MLA {
         @Override
         public void campaign() {
             System.out.println("Campaigns in nine constituencies");
         }
     }
     ```

3. **Polymorphism**
   - Polymorphism allows methods to do different things based on the object that is acting upon them.
   - Example:
     ```java
     MLA obj1 = new PM();
     obj1.campaign();
     ```

4. **Abstraction**
   - Abstraction involves hiding the implementation details and showing only the functionality to the user.
   - Example:
     ```java
     abstract class Printable implements Summable {
         public abstract void print();
     }
     ```

#### Equations

1. **Arithmetic Operations**
   - Basic arithmetic operations like addition, subtraction, multiplication, and division.
   - Example:
     ```java
     c.x = c.x + c1.x;
     c.y = c.y + c1.y;
     ```

2. **String Concatenation**
   - Concatenation of strings using the `+` operator.
   - Example:
     ```java
     return "name = " + name + ", salary = " + salary;
     ```

